task.summary:
Diverse Änderungen:
- native-lib.cpp: getThreadInterrupted() hinzugefügt um Berechnung untebrechen zu können, wenn Thread unterbrochen wird; Reader_getOnLowMemory() hinzugefügt um auf LowMemory zu überprüfen auch für Klasse SecondFragment; in endCalculation() werden die Variablen jetzt zurückgesetzt;  
- Client.java: Thread receiverThread hinzugefügt, da Reader.java jetzt "implements Runnable"; 
- Reader.java: jetzt "implements Runnable"; onLowMemory() hinzugefügt; receiveMessage() jetzt synchronized und while-Schleife hinzugefügt um zu überprüfen ob receiveThread unterbrochen wurde; in run() jetzt keine while-Schleife mehr; durch calculateThread.interrupt() im switch() der receiveMessage-Methode() wird Berechnung z.B. nach Klick auf zoomIn auf Serverseite unterbrochen und mit verändertem zoom-Wert neu berchnet
- FirstFragment.java: TextView tv entfernt und alle tv.setText() und tv.append(), da txtsample in first_fragment.xml entfernt wurde; getFragment() hinzugefügt für Zeile 505; in beiden AsyncTasks UI-Aktualisierung jetzt mit onPostExecute() und nicht mehr onProgressUpdate(); Zeile 397-405 hinzugefügt, da vorher diese Ausgaben in TextView tv ausgegeben wurden; 
- SecondFragment.java: TextView txtName hinzugefügt, damit deviceName dargestellt werden kann; pauseOOM() hinzugefügt, damit die Berechnung aufgrund von outOfMemoryException pausiert werden kann (stand jetzt nicht benutzt); 
- first_fragment.xml: ConstaraintLayout in LinearLayout geändert, damit sich das Layout an Bildschirmgröße anpasst; txtsample entfernt;
